import React, { useState } from 'react';

function Login() {
  // State to toggle between login and register
  const [isExistingUser, setIsExistingUser] = useState(true);

  // State for login form
  const [loginData, setLoginData] = useState({ username: '', password: '' });

  // State for register form
  const [registerData, setRegisterData] = useState({ username: '', email: '', password: '', confirmPassword: '' });

  // Handlers for input changes
  const handleLoginChange = (e) => {
    setLoginData({ ...loginData, [e.target.name]: e.target.value });
  };

  const handleRegisterChange = (e) => {
    setRegisterData({ ...registerData, [e.target.name]: e.target.value });
  };

  // Handlers for form submission (replace with your API logic)
  const handleLoginSubmit = (e) => {
    e.preventDefault();
    // TODO: Call your login API here
    alert(`Logging in as ${loginData.username}`);
  };

  const handleRegisterSubmit = (e) => {
    e.preventDefault();
    // TODO: Call your register API here
    alert(`Registering user ${registerData.username}`);
  };

  return (
    <div style={{ maxWidth: 400, margin: '40px auto', padding: 24, border: '1px solid #ddd', borderRadius: 8 }}>
      <div style={{ display: 'flex', justifyContent: 'center', marginBottom: 24 }}>
        <button
          onClick={() => setIsExistingUser(true)}
          style={{
            padding: '10px 20px',
            marginRight: 8,
            background: isExistingUser ? '#007bff' : '#f0f0f0',
            color: isExistingUser ? '#fff' : '#333',
            border: 'none',
            borderRadius: 4,
            cursor: 'pointer'
          }}
        >
          Existing User
        </button>
        <button
          onClick={() => setIsExistingUser(false)}
          style={{
            padding: '10px 20px',
            background: !isExistingUser ? '#007bff' : '#f0f0f0',
            color: !isExistingUser ? '#fff' : '#333',
            border: 'none',
            borderRadius: 4,
            cursor: 'pointer'
          }}
        >
          New User
        </button>
      </div>

      {isExistingUser ? (
        <form onSubmit={handleLoginSubmit}>
          <h2>Login</h2>
          <div style={{ marginBottom: 16 }}>
            <label>Username</label>
            <input
              type="text"
              name="username"
              value={loginData.username}
              onChange={handleLoginChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label>Password</label>
            <input
              type="password"
              name="password"
              value={loginData.password}
              onChange={handleLoginChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <button type="submit" style={{ width: '100%', padding: 10, background: '#007bff', color: '#fff', border: 'none', borderRadius: 4 }}>
            Login
          </button>
          <div style={{ marginTop: 12, textAlign: 'right' }}>
            <a href="/forgot-password" style={{ color: '#007bff', textDecoration: 'underline' }}>
              Forgot password?
            </a>
          </div>
        </form>
      ) : (
        <form onSubmit={handleRegisterSubmit}>
          <h2>Register</h2>
          <div style={{ marginBottom: 16 }}>
            <label>Username</label>
            <input
              type="text"
              name="username"
              value={registerData.username}
              onChange={handleRegisterChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label>Email</label>
            <input
              type="email"
              name="email"
              value={registerData.email}
              onChange={handleRegisterChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label>Password</label>
            <input
              type="password"
              name="password"
              value={registerData.password}
              onChange={handleRegisterChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label>Confirm Password</label>
            <input
              type="password"
              name="confirmPassword"
              value={registerData.confirmPassword}
              onChange={handleRegisterChange}
              required
              style={{ width: '100%', padding: 8, marginTop: 4 }}
            />
          </div>
          <button type="submit" style={{ width: '100%', padding: 10, background: '#007bff', color: '#fff', border: 'none', borderRadius: 4 }}>
            Register
          </button>
        </form>
      )}
    </div>
  );
}

export default Login;
